import React from 'react';
import styled from 'styled-components';

const FooterWrapper = styled.footer`
  width: 100%;
  padding: 2rem 0 1.5rem 0;
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 2.5rem;
  background: #fff;
  color: #222;
  font-size: 1.08rem;
  font-weight: 500;
  border-top: 1px solid #eee;
  @media (max-width: 600px) {
    flex-direction: column;
    gap: 1.1rem;
    font-size: 0.98rem;
  }
`;

const FooterLink = styled.a`
  color: #222;
  text-decoration: none;
  display: flex;
  align-items: center;
  gap: 0.5rem;
  &:hover {
    color: #184B54;
  }
`;

const XIcon = styled.svg`
  width: 1.5em;
  height: 1.5em;
  display: inline-block;
  vertical-align: middle;
  fill: currentColor;
`;

const Footer = () => (
  <FooterWrapper>
    <FooterLink href="https://x.com/HeptaCreative" target="_blank" rel="noopener noreferrer" aria-label="HeptaCreative on X">
      <XIcon viewBox="0 0 24 24" aria-hidden="true">
        <path d="M17.53 3H21l-7.19 8.19L22 21h-6.5l-5.18-6.19L3.5 21H0l7.81-8.89L2 3h6.5l4.7 5.62L17.53 3zm-2.13 16h2.2l-5.97-7.13-1.6 1.81L15.4 19zm-8.4 0h2.2l2.13-2.44-1.6-1.81L7 19zm1.47-14l3.07 3.67L14.6 5H8.47z" />
      </XIcon>
      X
    </FooterLink>
    <span>
      <FooterLink href="mailto:Hey@hepta.no">Hey@hepta.no</FooterLink>
    </span>
    <span>Oslo</span>
  </FooterWrapper>
);

export default Footer;
